import React, {Component} from "react";
import {Button} from "@material-ui/core";
import SysPopup from "./assets/components/CommonComponents/BasicComponents/SysPopup/SysPopup";

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isOpenPopup: false,
        }
    }
    render() {
        return(
            <div>
                <Button variant="contained" onClick={()=>{this.setState({...this.state, isOpenPopup: true})}}>Help</Button>
                <SysPopup Open={this.state.isOpenPopup} Title={"Help"} onClose={()=>{this.setState({...this.state, isOpenPopup: false})}}/>
            </div>
        );
    }
}

export default App;
